Estimated start time taken from Damage Survey...see below: 

Golf ball sized hail with a microburst. 

&quot;Witnesses describe heavy rain and golf-ball sized hail accompanying intense wind, most indicators blown from west though some trees down from south at northern edge of microburst, time given as 5-6pm - radar used to refine timing, worst damage at Albert's Marina (which was visited) but similar damage also occurred at South Bay Harbour Marina where ~20 boats were damaged by a collapsed boathouse structure there. Heavy tree damage also at River Drive off Queensville Sideroad and at Balmoral Heights in Queensville at the eastern edge of the microburst. HVN nursery on the southern edge of the path on Queensville Sideroad experienced just a few trees down. An East Gwillimbury official said no other damage was known at this time. Damage estimate is rough and includes damage to boats.	&quot;

